import React from "react";

export default class AlertInfo extends React.PureComponent {
	render() {
		return (
			<div className="alert">
				<div>{this.props.errorMessage}</div>
				<div>{this.props.errorCategory}</div>
				<div>{this.props.errorTime}</div>
			</div>
		);
	}
}
